import React from "react";
import NewPic from "../newpic.png";
import { MdKeyboardArrowRight } from "react-icons/md";

const Home = () => {
  return (
    <div>
      <div className=" hero container max-w-screen-lg mx-auto pb-3 flex ">
        <div class="w-64 carousel rounded-box hero container max-w-screen-lg mx-auto pb-10 flex ">
          <div class="carousel-item w-full">
            <img
              id="profilepic"
              src={NewPic}
              class="translate-x-6  w-full mx-auto rounded-2xl mt-3 "
              alt="PRO"
            />
          </div>
          <div class="carousel-item w-full">
            <img
              id="profilepic"
              src={NewPic}
              class="w-full mx-auto rounded-2xl mt-6 "
              alt="PRO"
            />
          </div>
          <div class="carousel-item w-full">
            <img
              id="profilepic"
              src={NewPic}
              class="w-full mx-auto rounded-2xl mt-6 "
              alt="PRO"
            />
          </div>
          <div class="carousel-item w-full">
            <img
              id="profilepic"
              src={NewPic}
              class="w-full mx-auto rounded-2xl mt-6 "
              alt="PRO"
            />
          </div>
        </div>
      </div>
    </div>
  );
};

export default Home;
